import React from "react";
import { Menu, MenuItem } from "@mui/material";
import { Link } from "react-router-dom";

interface ProsMenuPositioned {
  id: string;
  menu_id: string;
  anchorElement: HTMLElement | null;
  open: boolean;
  closeMenu: () => void;
  setValueMenuItem: (index: number) => void;
}

const MenuPositionedToolTip: React.FC<ProsMenuPositioned> = ({
  anchorElement,
  open,
  id,
  menu_id,
  closeMenu,
  setValueMenuItem,
}) => {
  return (
    <Menu
      id={menu_id}
      anchorEl={anchorElement}
      open={open}
      aria-labelledby={id}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      MenuListProps={{ onMouseLeave: closeMenu }}>
      <MenuItem
        component={Link}
        to='/customsoftware'
        onClick={() => {
          closeMenu();
          setValueMenuItem(1);
        }}>
        Custome Software Dev
      </MenuItem>
      <MenuItem
        component={Link}
        to='/customsoftware'
        onClick={() => {
          closeMenu();
          setValueMenuItem(1);
        }}>
        Custome Software Dev
      </MenuItem>
      <MenuItem
        component={Link}
        to='/mobileapps'
        onClick={() => {
          closeMenu();
          setValueMenuItem(1);
        }}>
        Mobile App Dev
      </MenuItem>
      <MenuItem
        component={Link}
        to='/websites'
        onClick={() => {
          closeMenu();
          setValueMenuItem(1);
        }}>
        Website Dev
      </MenuItem>
    </Menu>
  );
};

export default MenuPositionedToolTip;
